INFT\prosgaBundle\Entity\FichaDeProcesoSalida:
    type: entity
    table: FichaDeProcesoSalida
    fields:
        id:
            type: integer
            id: true
            generator:
                strategy: AUTO
        valoresDeSalida:
            type: string
            length: 255
            column: ValoresDeSalida
        observacion:
            type: string
            length: '1000'
            column: Observacion
            
    manyToOne:
        fichaDeProceso:
            targetEntity: FichaDeProceso
            joinColumn:
                name: fichaDeProceso_id
                referencedColumnName: id
            
    lifecycleCallbacks: {  }
